import React, { useState, useCallback } from "react";

import MoreHorizIcon from "@material-ui/icons/MoreHoriz";

import { Grid } from "@material-ui/core";
import { matchPc, matchTablet } from "../DetectDevice";
import { useSelector } from "react-redux";

function AboutColorx(): JSX.Element {
  ///
  /// GET DARKMODE FROM REDUX STORE
  interface RootStateGlobalReducer {
    GlobalReducer: {
      darkmode: boolean;
    };
  }
  const { darkmode } = useSelector((state: RootStateGlobalReducer) => ({
    ...state.GlobalReducer,
  }));

  const darkmodeReducer = darkmode;

  ///
  ///
  /// GET COLOR FROM REDUX STORE
  interface RootStateReducerColor {
    GlobalReducerColor: {
      color: string;
      colordark: string;
    };
  }
  const { color, colordark } = useSelector((state: RootStateReducerColor) => ({
    ...state.GlobalReducerColor,
  }));
  const colorReducer = color;
  const colorReducerdark = colordark;

  return (
    <>
      <Grid container>
        <Grid
          item
          xs={12}
          style={{ marginTop: "3vh", padding: "0px", marginLeft: "16px" }}
        >
          <Grid
            item
            xs={2}
            style={{
              width: `9vh`,
              height: `9vh`,
              position: "absolute",
              backgroundColor: darkmodeReducer
                ? colorReducerdark
                : colorReducer,
              borderRadius: "50%",
              zIndex: 0,
              marginLeft: "0%",
            }}
          >
            {" "}
          </Grid>
          <Grid
            item
            xs={2}
            style={{
              textAlign: "center",
              alignItems: "center",
              display: "grid",
              justifyContent: "center",
              marhin: "auto",
              width: `8vh`,
              height: `8vh`,
              position: "absolute",
              backgroundColor: darkmodeReducer
                ? "rgba(010,010,010, 0.7)"
                : "rgba(220,220,220, 0.7)",
              borderRadius: "50%",
              zIndex: 1,
              marginLeft: "0%",
            }}
          >
            {" "}
          </Grid>
        </Grid>{" "}
      </Grid>
    </>
  );
}

export const AboutColor = React.memo(AboutColorx);
